import React, { Fragment } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

class ProductAdmin extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            products:[],
            errmsg:''
        }
    }

    componentDidMount(){
        this.getProducts()

    }

    //get all rpoducts
    getProducts = () => {
        let dataUrl = `http://127.0.0.1:5000/api/products/`;
    axios.get(dataUrl).then((res) => {
        console.log(res.data)
        this.setState({
            products: res.data
        })

    }).catch((err) => {
        this.setState({
            errmsg:'error for loading data'
        })
    })
    }

    //delete
    deleteProduct = () => {
        let dataUrl = `http://127.0.0.1:5000/api/products/:id`;

    }
