        return(
            <Fragment>

                 <div className="container mt-4">

                    <div className="row">
                        <div className="col">
                            <p className="h3 text-success ">Products Admin</p>
                            <p className="lead">hsdjs sdhfsjd sdjhfskdf fsjdgfs fshdfgs</p>

                        </div>
                    </div>
                    <Link to={'/CreateProduct'} className="btn btn-success btn-sm">Create Product</Link>

                    <div className="row">
                        <div className="col">
                            <table className="table table-hover table-striped text-center table-success">
                                <thead className="bg-dark text-white">
                                    <tr>
                                    <th>s.no</th>
                                    <th>Name</th>
                                    <th>Image</th>
                                    <th>Price</th>
                                    <th>Quantity</th>
                                    <th>Info</th>
                                    <th>Actions</th>
                                    </tr>
                                </thead>
                                <tbody>
                                  {
                                    this.state.products ? 
                                    <React.Fragment>
                                        {
                                            this.state.products.map((product) => {
                                                return(
                                                    <tr>
                                                        <td>{product._id.substr(product._id.length - 4)}</td>
                                                        <td>{product.name}</td>
                                                        <td>
                                                            <img src={product.image} alt="image" height="70" width="70"/>
                                                        </td>
                                                        <td>&#8377;{product.price.toFixed(2)}</td>
                                                        <td>{product.quantity}</td>
                                                        <td>{product.info}</td>
                                                        <td>
                                                        <Link to={`/UpdateProduct/${product._id}`} className="btn btn-success btn-sm">Update Product</Link>
                                                        <Link to={'/'} className="btn btn-success btn-sm ml-3">Delete</Link>

                                                        </td>

                                                    </tr>
                                                )
                                            })
                                        }
                                    </React.Fragment> : null
                                  }
                                </tbody>
                            </table>
                            <pre>{JSON.stringify(this.state.products)}</pre>


                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default ProductAdmin
